import React from "react";
import "../App.css";
import Footer from "../components/organisms/Footer";
import Navbar from "../components/organisms/Navbar";
import SignUp from "./SignUp";

export default function ProfilePage() {
  const { user } = SignUp();

  return (
    <>
      <strong>User: </strong>
      {user}
      <h1>Profile Page</h1>
      <Footer />
    </>
  );
}
